// src/routes/routes.js
import React from 'react';
import { Route, Switch } from 'react-router-dom';
import PopisLovaca from '../pages/PopisLovaca';
import RasporedAktivnosti from '../pages/RasporedAktivnosti';
import PopisLova from '../pages/PopisLova';
import UnosDivljaci from '../pages/UnosDivljaci';
import UnosOdstrijela from '../pages/UnosOdstrijela';
import PopisBodova from '../pages/PopisBodova';

const Routes = () => {
    return (
        <Switch>
            <Route path="/popis-lovaca" component={PopisLovaca} />
            <Route path="/raspored-aktivnosti" component={RasporedAktivnosti} />
            <Route path="/popis-lova" component={PopisLova} />
            <Route path="/unos-divljaci" component={UnosDivljaci} />
            <Route path="/unos-odstrijela" component={UnosOdstrijela} />
            <Route path="/popis-bodova" component={PopisBodova} />
            {/* Ovdje mo≈æete dodati dodatne rute ako je potrebno */}
        </Switch>
    );
};

export default Routes;
